// name: Cloud Position
// credit: SkyBuilder1717
// description: Gets advanced info about users location, through Cloud Servers.


// Created in Visual Studio Code

// This extension needs to be unsandboxed to run!
(async function(Scratch) {
    const blocks = [];

    if (!Scratch.extensions.unsandboxed) {
        alert("This extension needs to be unsandboxed to run!")
        return
    }

    class Extension {
        getInfo() {
            return {
                "blockIconURI": "data:image/png;base64,",
                "id": "CloudPosition",
                "name": "Cloud Position",
                "color1": "#7c1322",
                "color2": "#a90f26",
                "tbShow": true,
                "blocks": blocks,
                "menus": {
                    locationMenu: {
                        items: ["location", "city", "country"]
                    },
                    languMenu: {
                        items: ["language", "language (natural)", "country emoji"]
                    }
                }
            }
        }
    }
    function httpGet(theUrl, returnResponse) {
        let xmlHttp = new XMLHttpRequest();
        xmlHttp.open("GET", theUrl, false);
        xmlHttp.send(null);
        if (returnResponse == true) {
            return xmlHttp
        } else {
            return xmlHttp.responseText
        }
    };
    function getCloudInfor() {
        let str = httpGet("https://api.bigdatacloud.net/data/ip-geolocation?key=d9e53816d07345139c58d0ea733e3870");
        str = JSON.parse(str);
        return str
    };
    function checkPort(ip, port) {
        fetch('https://www.yougetsignal.com/tools/open-ports/api.php?host=${ip}&port=${port}')
        .then(response => response.json())
        .then(data => {
            return response;
        })
        .catch(error => {
            throw new Error("Happened check error!");
        });
    };
    function createBlock(type, id, text, argsument, func) {
        blocks.push({
            opcode: id,
            blockType: type,
            text: text,
            arguments: argsument,
            disableMonitor: true,
            isEdgeActivated: false
        });
        Extension.prototype[id] = func;
    };

    createBlock(Scratch.BlockType.REPORTER, "getCloudIP", "get my IP address", {}, async (args, util) => {
        return getCloudInfor()["ip"]
    });

    createBlock(Scratch.BlockType.REPORTER, "getCloudLastUpdated", "last updated", {}, async (args, util) => {
        return getCloudInfor()["lastUpdated"]
    });

    createBlock(Scratch.BlockType.REPORTER, "getCloudProvider", "provider", {}, async (args, util) => {
        return getCloudInfor()["network"]["carriers"][0]["name"]
    });

    createBlock(Scratch.BlockType.REPORTER, "getCloudOrganization", "organization", {}, async (args, util) => {
        return getCloudInfor()["network"]["organisation"]
    });

    createBlock(Scratch.BlockType.REPORTER, "getCloudLocation", "get [location]", {
        location:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "locationMenu",
        }
    }, async (args, util) => {
        if (args["location"] == "city") {
            return getCloudInfor()["location"]["city"]
        } else if (args["location"] == "country") {
            return getCloudInfor()["country"]["name"]
        } else if (args["location"] == "location") {
            return getCloudInfor()["location"]["isoPrincipalSubdivision"]
        }
    });

    // Temporary disabled
    // createBlock(Scratch.BlockType.BOOLEAN, "checkPortForValid", "check port [port] on [ip]", {
    //     port:
    //     {
    //         type: Scratch.ArgumentType.NUMBER,
    //         defaultValue: 25565
    //     },
    //     ip:
    //     {
    //         type: Scratch.ArgumentType.STRING,
    //         defaultValue: "192.168.0.1"
    //     }
    // }, async (args, util) => {
    //     return checkPort(args["ip"], args["port"]);
    // });

    createBlock(Scratch.BlockType.REPORTER, "getCloudOfUser", "[langu] of user", {
        langu:
        {
            type: Scratch.ArgumentType.STRING,
            menu: "languMenu",
        }
    }, async (args, util) => {
        if (args["langu"] == "language") {
            return getCloudInfor()["country"]["isoAdminLanguages"][0]["isoName"]
        } else if (args["langu"] == "language (natural)") {
            return getCloudInfor()["country"]["isoAdminLanguages"][0]["nativeName"]
        } else if (args["langu"] == "country emoji") {
            return getCloudInfor()["country"]["countryFlagEmoji"]
        }
    });

    Scratch.extensions.register(new Extension());
})(Scratch);
